import React, { Fragment } from 'react';
import { GenericStyle } from '../app_styles';
import { NavigationBar } from './NavigationBar';
import Title from './Title';
import BaseInformation from './BaseInformation';
import { useParams, Link } from 'react-router-dom';
import { getDataFromServer, generateData } from "../utils/dataFromServer";
import SubTitle from "./SubTitle";
import { Table } from './Table';
import { SliderColumnFilter, SelectColumnFilter } from "../Filters/Filters";
import DateFilter from '../Filters/DateFilter';
import { Scrollbars } from 'react-custom-scrollbars-2';
//import NotifyMe from 'react-notification-timeline';

//import { NotificationApp } from "./NotificationApp"
export function TPage() {

    const columns_to_delete = React.useMemo( //useMemo returns a memoized value- runs when one of its dependencies update.
        () => [
            {
                Header: process.env.REACT_APP_FIRST_HEADER_MAIN_TABLE,
                columns: [
                    {
                        Header: '',
                        accessor: 'checkboxcol',
                        show: false,
                        Cell: ({ cell }) => (
                            <Link to={`/Home/TPage/${cell.pk}`}>
                                <input type="checkbox" />
                            </Link>
                        )
                    },
                    {
                        Header: 'PK',
                        accessor: 'pk',
                        show: false,
                    },
                    {
                        Header: 'Type',
                        accessor: 'type',
                        show: true,
                    },
                    {
                        Header: 'Name',
                        accessor: 'name',
                        // Use our custom `fuzzyText` filter on this column

                        ////onClick={route_to_Tpage}
                        filter: 'fuzzyText',
                        Cell: ({ cell }) => (
                            <Link to={`/Home/TPage/${cell.value}`} style={{ color: 'inherit', textDecoration: 'inherit' }}>
                                {/* <button value={cell.value} >  */}
                                {cell.value}
                                {/* </button> */}
                            </Link>

                        )
                    },
                ],
            },
            {
                Header: process.env.REACT_APP_SECOND_HEADER_MAIN_TABLE,
                columns: [
                    {
                        Header: 'Version',
                        accessor: 'version',
                        Filter: SliderColumnFilter,
                        filter: 'equals',
                    },
                    /*  {
                        Header: 'Visits',
                        accessor: 'visits',
                        Filter: NumberRangeColumnFilter,
                        filter: 'between',
                      },*/
                    {
                        Header: 'Status',
                        accessor: 'status',
                        Filter: SelectColumnFilter,
                        filter: 'includes',

                        // formatter: AddButtonToCell,
                    },
                    /*  {
                        Header: 'Profile Progress',
                        accessor: 'progress',
                        Filter: SliderColumnFilter,
                        filter: filterGreaterThan,
                      },*/
                    {
                        Header: 'Date',
                        accessor: 'date',
                        Filter: ({ filter, onChange }) => <DateFilter onChange={onChange} />,
                    },

                ],
            },
        ],
        []
    )


    console.log("hereee")
    const { t_id } = useParams();
    const data = getDataFromServer('/t');
    const f = generateData(data)



    console.log("ffff")
    console.log(data)

    // return(
    //     <Fragment>
    //         <Table1><Row></Row><Row></Row><Row></Row></Table1>
    //         <Table2><Row></Row><Row></Row><Row></Row></Table2>
    //         <Table3><Row></Row><Row></Row><Row></Row></Table3>
    //     </Fragment>
    // )



    let columns, rows;


    return (<GenericStyle>
        <NavigationBar />
        {/* <NotificationApp></NotificationApp>*/}
        <Scrollbars style={{ width: 500, height: 300 }}>

            <Title message="Summery of" name="t_name" pk={t_id} />
            <BaseInformation />
            <Fragment key="tpage_id">
                {data.map(function (item) {
                    if (Object.keys(item).length != 0) {
                        console.log("here2")
                        console.log(item.type.normalize() === 'table'.normalize())
                        if (item.type.normalize() === 'table'.normalize()) {
                            console.log("here3")
                            columns = item.data.headers
                            rows = item.data.rows
                            return <Table columns={columns_to_delete} data={rows} columns_name={columns} />
                        } else if (item.type.normalize() === 'message'.normalize()) {
                            return <SubTitle title={item.data} />
                        }
                    }
                })
                }
                {/*{this.props.children}*/}
                {/* <SubTitle title="table2 title" />
            <SubTitle title="table3 title" />
            <SubTitle title="table4 title" /> */}
            </Fragment>

            {/* <Title></Title>
                    <BaseInformation></BaseInformation>
                    <Table></Table> */}
        </Scrollbars>
    </GenericStyle>
    )
}
